"use strict";

function countLatticePoints(circles) {
    let ans = 0;
    let imx = Math.max(...circles.map(([x, _, r]) => x + r));
    let jmx = Math.max(...circles.map(([_, y, r]) => y + r));
    for (let i = 0; i <= imx; i++) {
        for (let j = 0; j <= jmx; j++) {
            for (let [x, y, r] of circles) {
                x -= i;
                y -= j;
                if (x * x + y * y <= r * r) {
                    ans++;
                    break;
                }
            }
        }
    }
    return ans;
}
